[_interviews_amy_mitchell_firsttime_01_webm__WEBPACK_IMPORTED_MODULE_5___default.a]: "I was very lucky with my experiences with getting to watch symphony because my mother was the physical therapist for the Houston Symphony Orchestra. And so from a pretty young age (middle school) I was backstage at Houston Symphony concerts meeting all the musicians, and I was a little girl so they thought that was cool, and they would find special seats for me, and play little special licks and wink and me in the middle of the concert and things like that. I just had this idea that people who played in the symphony were the nicest most magical people on the planet. Thats my experience getting to know them as human beings as well as enjoying their music.",
[_interviews_amy_mitchell_instrument_01_webm__WEBPACK_IMPORTED_MODULE_6___default.a]: "When I was graduating from fifth grade, our sixth grade orchestra teacher (the middle school orchestra teacher) came to talk to the fifth grade class about what instruments we could play in the middle school orchestra. And she demonstrated the violin, and that was fine. And the viola was kinda neat, I liked the lower sound. But then when she played the cello, she sat down. And then I thought that is the instrument for me. And I actually decided to play the cello when she mentioned that they kept the cellos at school for you, so you didnt have to carry your cello back and forth to school. And I had been playing piano for a couple years and knew that I didn;t like to practice. And I thought, well if the cello is at school,  dont have to bring it home, so I must not have to practice. That is definitely the instrument I want to play. And I went home, told my mother I want  to play the cello, I dont want to play the piano anymore. Its the cello. I dont know why but she said Okay well do the cello now. And of course we rented a cello to keep at home, and there was one at school, and I had to practice a lot. But it was such a social instrument after playing piano that it was a much more satisfying, rewarding experience. Since it was in a group of people and it was kind of competitive, and I liked that.",
